import styled from 'styled-components';

export const Outbox = styled.div`
    /* display: flex;
    vertical-align: center;
    align-items: center; */
    background-image: url("./img/Bg.jpg");
    text-align: center;
    width: 100vw;
    height: 100vh;
    margin: 0 auto;

    @media screen and (min-width: 500px) {
        width: 500px;
    }

`
